SEN HONDO: Crusader SHQ - This is pilot Hondo. Patrol Group 17's been ambushed. I think it's the Nine Tails. They had scan blocks. Didn't seem 'em till it was too late. Taking heavy damage. It's not good. I've lost power to thrusters 3 and 4. Shit 6 is gone. I'm not going to be able to-  

/**End_Transcription**/

mobiglas_Blackbox_02_text:
/**MOBICONNECT.RETRIEVALSYSTEM.FRP…DATAFOUND**/
/**EDR_Transcription**/

ERIN DEMETER: Damn it. Damn it. It was a scythe. You hear me, Donny? A damn scythe. Thought it was one of the converted jobs. Some hotshot showing off. But it was 'duul. Thing flew at me like like - like - shit. I barely got a shot off... Donny, do right by me okay? 

/**End_Transcription**/

mobiglas_Blackbox_03_text:
/**MOBICONNECT.RETRIEVALSYSTEM.FRP…DATAFOUND**/
/**EDR_Transcription**/

RYAN PARTHI: Mayday, mayday. If anyone can hear me, my convoy was hit while in transit. Bastards had taken out the array so we couldn't get out a proper distress. They shot up my ship and vented the others... vented them like they were nothing. They're dragging my ship somewhere. Guess they thought they killed me. I'm sending out a low pulse distress, hopefully they won't pick it up. If you're in the area. Please, help.

/**End_Transcription**/

mobiglas_Blackbox_04_text:
/**MOBICONNECT.RETRIEVALSYSTEM.FRP…DATAFOUND**/
/**EDR_Transcription**/

DANNY COLLINS: Day seventy-three. Very excited to be coming up to Crusader. Ever since the jump point, I've been working out a rough schedule of what to visit. By my estimation, I can sightsee for four hours if I want to keep my schedule for the rest of the system. <pause> That's weird... just got an alert that says an airlock was triggered... I swear the new operating system is designed to not work with these older models. Anyway, still undecided about whether to visit Hurston or not. Place is already kinda-

UNIDENTIFIED: Kinda scary?

/**End_Transcription**/
